import React from "react";
function GroupModal(props) {
    function close() {
        console.log("Closed");
    }
    return (
        <div onSubmit={e => props.addGroup(e)} className="col-3">
            <form>
                <div className="form-group">
                    <label htmlFor="exampleInputName">Name</label>
                    <input type="text" className="form-control" id="exampleInputName" aria-describedby="nameHelp" placeholder="Enter the name" />
                </div>
                <div className="row">
                    <div className="col-6">
                        <button type="submit" className="btn btn-primary text-center">Submit</button>
                    </div>
                    <div className="col-6">
                        <button type="button" className='btn btn-danger m-auto' onClick={close}>Cancel</button>
                    </div></div>
            </form>
        </div>
    );
}
export default GroupModal;
